    return <div>
        <Comp  {...props} />
    </div>
}

const Foo = foo(Child);

export default class HOCpage extends Component {
    render() {
        console.log(Foo);
        return (
            <div>
                HOCpage
                <Foo />
            </div>
        )
    }
}
